commits.sourceNew:
/** for testing DateTools support */
private String getDate(Date d, DateTools.Resolution resolution)
    throws Exception {
  if (resolution == null) {
    return DateField.dateToString(d);
  } else {
    return DateTools.dateToString(d, resolution);
  }
}

